import Header from '../components/Header';
import Head from 'next/head'

const Index = () => (
    <div className="app">
        <Head>
            <meta content="Cher 👩‍💻🔥 Principal Software Engineer" property="og:title" />
        </Head>
        <Header />
    </div>
);

export default Index;
